import React, { useState } from 'react';
import api from '../api/api'; 
import { useNavigate, Link } from 'react-router-dom';

function Login({ onLoginSuccess }) {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        try {
            const response = await api.post('/auth/login', { email, password });
            
            const { accessToken, user } = response.data;

            if (!accessToken) {
                setError('No se recibi칩 token v치lido');
                return;
            }

            localStorage.setItem('token', accessToken);
            if (onLoginSuccess) onLoginSuccess(accessToken);

            if (user && user.rol === 'Admin') {
                navigate('/admin');
            } else {
                navigate('/bienvenida');
            }

        } catch (err) {
            console.error(err);
            setError('Email o contrase침a incorrectos');
        }
    };

    // --- ESTILOS ADAPTADOS AL NEGRO AZULADO ---

    const gradientAnimationCss = `
        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }
    `;

    const PAGE_CONTAINER = { 
        minHeight: '100vh', 
        // FONDO NEGRO AZULADO ANIMADO
        background: 'linear-gradient(270deg, #1e293b, #334155, #1e293b)', 
        backgroundSize: '400% 400%',
        animation: 'gradientShift 20s ease infinite',
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center', 
        justifyContent: 'center',
        position: 'relative',
        overflow: 'hidden'
    };
    
    const navBarButtonStyle = { 
        background: '#7dd3fc', 
        color: '#1e293b', 
        padding: '10px 25px', 
        borderRadius: 25, 
        border: '1px solid #7dd3fc', 
        fontWeight: 'bold',
        cursor: 'pointer',
        textDecoration: 'none',
        transition: 'all 0.3s ease',
        boxShadow: '0 2px 5px rgba(0,0,0,0.3)',
        ':hover': {
            background: '#3b82f6', 
            color: '#fff',
            transform: 'translateY(-1px)'
        }
    };
    
    const formCardStyle = { 
        width: 450, 
        // Fondo de tarjeta (Azul-negro semitransparente)
        background: 'rgba(51, 65, 85, 0.95)', 
        backdropFilter: 'blur(10px)', 
        borderRadius: 20, 
        border: '2px solid #475569', 
        padding: 40, 
        boxShadow: '0 12px 30px rgba(0,0,0,0.6)', 
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center',
        zIndex: 10, 
        color: '#cbd5e1' // Texto gris claro
    };
    
    const welcomeBannerStyle = { 
        // Banner Lila (Acento del Dashboard)
        background: '#a78Bfa', 
        color: '#1e293b',
        borderRadius: 10, 
        marginBottom: 25, 
        padding: '12px 0', 
        width: '100%', 
        textAlign: 'center', 
        fontWeight: 'bold',
        fontSize: 22, 
        letterSpacing: '0.5px',
        textShadow: '1px 1px 2px rgba(0,0,0,0.2)'
    };
    
    const inputStyle = { 
        width: '100%', 
        padding: 14, 
        marginBottom: 25, 
        borderRadius: 10, 
        background: '#1e293b', // Input m치s oscuro
        fontSize: 18, 
        border: '1px solid #475569',
        color: '#fff',
        transition: 'border-color 0.3s ease, box-shadow 0.3s ease',
        boxShadow: 'inset 0 1px 3px rgba(0,0,0,0.3)',
        ':focus': {
            borderColor: '#a78Bfa', // Borde lila al enfocar
            boxShadow: '0 0 0 3px rgba(167, 139, 250, 0.3)'
        }
    };
    
    const submitButtonStyle = { 
        // Bot칩n principal (Verde de Acento)
        width: '100%', 
        background: '#10b981', 
        color: '#1e293b', 
        padding: 16, 
        borderRadius: 10, 
        fontWeight: 'bold', 
        fontSize: 18, 
        border: 'none', 
        marginBottom: 15,
        cursor: 'pointer',
        transition: 'background 0.3s ease, transform 0.2s ease',
        boxShadow: '0 5px 15px rgba(0,0,0,0.4)',
        ':hover': {
            background: '#0e9e71', 
            transform: 'translateY(-2px)'
        }
    };
    
    const secondaryButtonStyle = { 
        width: '100%', 
        background: '#475569', 
        color: '#cbd5e1', 
        padding: 12, 
        borderRadius: 10, 
        fontSize: 16, 
        border: 'none',
        cursor: 'pointer',
        transition: 'background 0.3s ease, border-color 0.3s ease',
        ':hover': {
            background: '#64748b'
        }
    };

    const labelStyle = { 
        marginBottom: 5, 
        display: 'block', 
        fontWeight: 'bold', 
        color: '#cbd5e1', 
        fontSize: 16 
    };

    return (
        <div style={PAGE_CONTAINER} className="animated-background-dots">
            {/* Insertar la animaci칩n CSS directamente */}
            <style>{gradientAnimationCss}</style>

            {/* Barra superior */}
            <div style={{ width: 550, display: 'flex', justifyContent: 'space-around', marginBottom: 60, zIndex: 10 }}>
                <Link to="/contacto" style={navBarButtonStyle}>Contactanos</Link>
                <button style={{...navBarButtonStyle, background: '#a78Bfa', color: '#1e293b'}}>Login</button>
                <Link to="/" style={navBarButtonStyle}>Inicio</Link>
            </div>
            
            {/* Card central */}
            <div style={formCardStyle}>
                <div style={welcomeBannerStyle}>游녦 Bienvenido de vuelta</div> 
                <form style={{ width: '100%' }} onSubmit={handleSubmit}>
                    <label style={labelStyle}>Email</label>
                    <input type="email" value={email} onChange={e => setEmail(e.target.value)} style={inputStyle} required />
                    
                    <label style={labelStyle}>Contrase침a</label>
                    <input type="password" value={password} onChange={e => setPassword(e.target.value)} style={inputStyle} required />
                    
                    <button type="submit" style={submitButtonStyle}>Ingresar</button>
                    
                    {error && <div style={{ color: '#ef4444', textAlign: 'center', marginBottom: 12, fontSize: 15 }}>{error}</div>}
                </form>
                <button style={secondaryButtonStyle}>Olvid칠 mi contrase침a</button>
            </div>
        </div>
    );
}

export default Login;
